<p>
People with depression are often described as being bedridden and unable to live a normal life. 
According to surveys, 10 percent of Americans suffer from depression. 
Some people may not even realise they are depressed, including those with "smiling depression",
defined as a person who appears happy in front of others, but suffers from depression on the inside. 
Smiling depression is not always easy to detect. 
They often appear to be as happy as normal people. 
Underneath the mask, they are suffering from sadness, panic, low self-esteem and insomnia. 
They may even plan and act on suicide, and because of this, smiling depression can be more dangerous than typical major depression. 
Fortunately, smiling depression is relatively easy to treat, and patients can undergo counselling or psychotherapy and share their feelings openly, which can go a long way to curbing depressive thoughts. 
If the patient does not want the condition to get worse, opening up is paramount.
</p>

> 抑郁症患者通常被描述为卧床不起，无法正常生活。据调查显示，有10%的美国人患有抑郁症。而有些人甚至可能没有意识到自己身处抑郁之中，其中就有“微笑抑郁症”患者，其定义是，人前显得很快乐，但内心却备受抑郁症的煎熬。并且微笑抑郁症往往不易被察觉。他们往往看起来和正常人一样一切安好。而在面具之下，他们正深受悲伤、恐慌、自卑、失眠之苦。他们甚至会计划自杀并采取行动，正因如此，微笑抑郁症可能比典型的重度抑郁症郑家危险。所幸的是，微笑抑郁症是比较容易治疗的，患者可以进行心理咨询或者心理治疗并敞开心扉分享感受，这能够很好的抑制抑郁想法。如果患者不想病情变得更糟，敞开心扉是最重要的。




